const TaskData = ({
    data: {
        title,
        priority,
        status,
        description
    }
  }) => {

  return (
    <label className="todo new-item">
        <div className="todo__text">{title}</div>
        <div className="todo__text">{priority}</div>
        <div className="todo__text">{status} DROPDOWN</div>
        <div className="todo__text">{description}</div>
    </label>
  );
};

export default TaskData;
